using namespace std;
const int MAX = 1e5;
const double INF = 1e9;

int main()
{
	int N;
	cin >> N;
	vector<int> a(N);
	for (int i = 0; i < N; i++) {
		cin >> a[i];
	}
	vector<vector<double>> dp(N + 1, vector<double>(MAX, INF));
	for (int i = 1; i < MAX; i++) {
		dp[0][i] = 0;
	}
	for (int i = 0; i < N; i++) {
		for (int j = 1; j < MAX; j++) {
			for (int k = j; k < MAX; k += j) {
				dp[i + 1][k] = min(dp[i + 1][k], max(dp[i][j], (double)abs(k - a[i]) / a[i]));
			}
		}
	}
