long long n, pre,last;
int main()
{
	double ans = 0.0;
	scanf("%lld", &n);
	if (n == 0)
	{
		printf("0.000000000000\n"); return 0;
	}
	scanf("%lld", &pre);
	if (n == 1)
	{
		printf("0.000000000000\n"); return 0;
	}
	for (int i = 2; i <= n; i++)
	{
		scanf("%lld", &last);
		long long tmp = last / pre;
		if (pre*tmp == last)
		{
			pre = tmp;
			continue;
		}
		else
		{
			if (pre*tmp < last)
			{
				if (pre*tmp + pre*(tmp + 1) < 2 * last)
				{
					tmp++;
				}
			}
			else
			{
				if (pre*tmp + pre*(tmp - 1) > 2 * last)
				{
					tmp--;
				}
			}
			double t = (double)abs(last - pre*tmp) / (last);
			if (ans < t)ans = t;
			last = pre*tmp;
		}
	}
	printf("%.12lf\n", ans);
}

