int N;
int V[22];
int LB[22], UB[22];

bool able(Double x) {
	for_(i,0,N) {
		Double LBi = (Double)V[i] - (Double)V[i] * x;
		Double UBi = (Double)V[i] + (Double)V[i] * x;

		LB[i] = (int)ceil(LBi);
		UB[i] = (int)floor(UBi);
	}

	//for_(val,LB[0],UB[0] + 1) {
		//int vi = val;
		int vi = LB[0];
		bool flag = true;

		for_(i,1,N) {
			if (vi > UB[i]) {
				flag = false;
				break;
			}

			if (LB[i] <= vi) continue;

			int low_mul = LB[i] / vi;

			if (LB[i] <= vi * low_mul && vi * low_mul <= UB[i]) {
				vi *= low_mul;
				continue;
			}

			if (LB[i] <= vi * (low_mul + 1) && vi * (low_mul + 1) <= UB[i]) {
				vi *= (low_mul + 1);
				continue;
			}

			flag = false;
			break;
		}

		if (flag) return true;
	//}

	return false;
}

void solve() {
	Double lb = 0, ub = 1e5;

	for_(i,0,1000) {
		Double med = (lb + ub) / 2.;
		if (able(med)) ub = med;
		else lb = med;
	}

	printf("%.9lf\n", lb);
}

int main() {
	cin >> N;
	for_(i,0,N) cin >> V[i];
	solve();
	return 0;
}

