	if(i==n) return true;

	bool f;
	int tmp;
	for(int b=(a[i]+a[i-1]-1)/a[i-1]*a[i-1];abs(a[i]-b)<ub*a[i];b+=a[i-1]){
		tmp=a[i];
		a[i]=b;
		f=isOK(i+1,ub);
		a[i]=tmp;
		if(f) return true;
	}
	for(int b=a[i]/a[i-1]*a[i-1];abs(a[i]-b)<ub*a[i];b-=a[i-1]){
		if(b<a[i-1]) break;
		tmp=a[i];
		a[i]=b;
		f=isOK(i+1,ub);
		a[i]=tmp;
		if(f) return true;
