int i,j,k,l,m,n,a[100000];
const double eps=1e-9;
int sou(int x,int y,double m)
{
    if(x==n)
    return 1;
    double R=m*a[x+1]+a[x+1];
    double L=a[x+1]-m*a[x+1];
    if(L<=1)
    L=1;
    if(R<y)
    return 0;
    if(L<=y+eps&&y<=R+eps)
    return sou(x+1,y,m);
    int z=L/y;
    int t=z*y;
    if(fabs(t-a[x+1])<=m*a[x+1]+eps)
    return sou(x+1,t,m);
    z++;
    t=z*y;
    if(fabs(t-a[x+1])<=m*a[x+1]+eps)
    return sou(x+1,t,m);
    return 0;
}
int main()
{

    scanf("%d",&n);
