    {
        double m=(L+R)/2;
        k=0;
        for(j=1;;j++)
        {
            if(fabs(j-a[1])<=m*a[1]+eps)
            {
                k=sou(1,j,m);
                if(k)
                break;
            }
            if(eps+j-a[1]>m*a[1])
            break;
        }
        if(k)
        R=m;
        else
        L=m;
    }
    printf("%.9lf\n",L);
