void dfs(int dep, int fa, int p, int q) {
//	if(ret > ans) return ;
	if((ll)p*ansq > (ll)q *ansp) return ;

	if(dep == n) {
		if((ll)p*ansq < (ll)q *ansp) {
			ansq = q;
			ansp = p;
		}
		return ;
	}
	int d = a[dep] % fa;
	if(d >= fa - d) {
//		dfs(dep + 1, a[dep] + fa - d, max(ret, (double)(fa-d)/a[dep]));
		if((ll)p * a[dep] > (ll)q * (fa - d))
			dfs(dep + 1, a[dep] + fa - d, p, q);
		else
			dfs(dep + 1, a[dep] + fa - d, fa-d, a[dep]);
	}
	if(d <= fa - d) {
//		dfs(dep + 1, a[dep] - d, max(ret, (double)(d)/a[dep]));
		if((ll)p * a[dep] > (ll)q * d)
			dfs(dep + 1, a[dep] - d, p, q);
		else
			dfs(dep + 1, a[dep] - d, d, a[dep]);
	}
}
