#include <bits/stdc++.h>

using namespace std;

namespace {
    typedef double real;

    int N;
    vector<int> A;
    void input() {
        cin >> N;
        A.clear(); A.resize(N);
        for (int i = 0; i < N; i++) {
            cin >> A[i];
        }
    }

    const int L = int(1e5) * 2;
    const real INF = 1e9;

    real calc(int a, int b) {
        // ある貨幣を価値aから価値bに変更するときのコスト
        return abs(real(a - b)) / a;
    }

    void solve() {
        /* dp[i][j] :: i番の貨幣価値をjにして、0 ~ i番までの貨幣体系がbeautifulになるよう調整する最小コスト */
        vector< vector<real> > dp(N, vector<real>(L, INF));
        for (int j = 1; j <= 2 * A[0]; j++) {
            dp[0][j] = calc(A[0], j);
        }
        for (int i = 1; i < N; i++) {
            for (int j = 1; j <= 2 * A[i]; j++) { // コストが1を越えることはないので, もとの価値の高々2倍までみればよい
                int x = j;
                for (int k = 1; k * k <= x; k++) {
                    if (x % k == 0) {
                        int a = k, b = x / k;
                        dp[i][j] = min(dp[i][j], max(dp[i - 1][a], calc(A[i], j)));
                        dp[i][j] = min(dp[i][j], max(dp[i - 1][b], calc(A[i], j)));
                    }
                }
            }
        }
        real ans = INF;
        for (int j = 1; j <= 2 * A[N - 1]; j++) {
            ans = min(ans, dp[N - 1][j]);
        }
        printf("%.12lf\n", ans);
    }
}

int main() {
    input(); solve();
    return 0;
}

