const double eps = 1e-10;

int a[30];
int sl[30],sr[30];
int n;
bool flag;

void dfs(int k,int last){
	if (k>n){
		flag=true;
		return;
	}
	int tmp = last;
	last*=2;
	while (flag==false && last<=sr[k]){
		if (last>=sl[k]) dfs(k+1,last);
		last+=tmp;
	}
}

bool check(double diff){
	for (int i=1;i<=n;++i){
		int tmp = floor(a[i]*diff+eps);
		sl[i]=max(1,a[i]-tmp);
		sr[i]=min(a[i]+tmp,100000);
	}
	flag = false;
