const double eps = 1e-8;  

bool check()
{
	for (int i=2;i<=n;i++)
	{
		if (s[i]%s[i-1])
		{
			return 0;
		}
	}

	return 1;
}

bool dfs(double now,int w,double nowmax)
{
	if (w==n+1)
	{
		ans=min(ans,nowmax);
		return 1;
	}
	bool flag=0;
	int L=(int)s[w]-s[w]*now+0.9999999;
	if (L<1)
	{
		L=1;
	}
	int R=(int)s[w]+s[w]*now;
	for (int i=L;i<=R;i++)
	{
		if (i%a[w-1]==0)
		{
			a[w]=i;
			flag=(flag || dfs(now,w+1,max(nowmax,fabs(a[w]-s[w])/s[w]*1.0)));
		}

	}
	return flag;
}


int main()
{
	scanf("%d",&n);
	for (int i=1;i<=n;i++)
	{
		scanf("%d",&s[i]);
	}

	if (check())
	{
		ans=0;
	}
	else
	{
		double l=0;
		double r=1;
		double mid;
		ans=1;
		a[0]=1;
		while (r-l>eps)	
		{
			mid=(l+r)/2;
			if (dfs(mid,1,0))
			{
				r=mid;
			}
			else
			{
				l=mid;
			}
		}
	}

	printf("%.12lf\n",ans);

	return 0;
}

