#define MAXN 100001
const double EPS= 1e-9;
double f[21][MAXN],a[21];
double min(double i,double j)
{
    return i<j?i:j;
}
double max(double i,double j)
{
    return j<i?i:j;
}
inline double get(double a,double b)
{
    if(fabs(a-b)<=EPS)
            return 0.0;
    return (fabs(a-b)/a);
}
int main()
{
    int n,i,j,k;
   while(scanf("%d",&n)!=EOF)
    {
        for(i=1;i<=n;i++)
            for(j=0;j<MAXN;j++)
                f[i][j]=1;
        for(i=1;i<=n;i++)
            scanf("%lf",a+i);
        for(i=1;i<MAXN;i++)
            f[1][i]=get(a[1],i);
        for(i=1;i<n;i++)
        {
            for(j=1;j<MAXN;j++)
            {
                k=1;
                while(k*j<MAXN)
                {
                    f[i+1][k*j]=min(f[i+1][k*j],max(f[i][j],get(a[i+1],k*j)));
                    k++;
                }
            }

        }
        double ans=1;
        for(i=1;i<MAXN;i++)
            ans=min(ans,f[n][i]);

        printf("%.9lf\n",ans);
    }
    return 0;
}

