        tmp_ratio
          = max(tmp_ratio,min(ratio1,ratio2));

        prev = (ratio1 < ratio2 ? next1 : next2);
      }
      res = min(res,tmp_ratio);
    }
    printf("%.12lf\n",res);
  }
}

