#define N 25
#define inf 2147483647
#define db double
#define max(a, b) ((a) > (b) ? (a) : (b))
#define min(a, b) ((a) < (b) ? (a) : (b))
#define swap(T, a, b) ({T ttt = a; a = b; b = ttt;})
int n, a[N], L, R; 
db t = 0, Ans = inf; 
int abs(int x) { return x > 0 ? x : -x; } 
db Up(int k, int x) 
{
          if (k == n + 1) return 0; 
          int t = a[k] / x, tA = abs(x * t - a[k]), tB = abs(x * (t + 1) - a[k]); 
          if (tA < tB)
             return max((db)tA / a[k], Up(k + 1, x * t));
          else
              return max((db)tB / a[k], Up(k + 1, x * (t + 1))); 
}
db Down(int k, int x)
{
            if (!k) return 0; 
            int t = x / a[k], tA = abs(a[k] * t - x), tB = abs(a[k] * (t + 1) - x); 
            if (tA < tB)
               return max((db)tA / a[k], Down(k - 1, x / t));
            else
                return max((db)tB / a[k], Down(k - 1, x / (t + 1))); 
}
int main()
{
    scanf("%d", &n); 
    for (int i = 1; i <= n; i++) scanf("%d", &a[i]); 
    for (int i = 1; i <= n; i++) 
    {
        L = max(1, a[i - 1]); R = min(a[n], a[i + 1]);
        for (int j = L; j <= R; j++)
        {
            t = (db)abs(a[i] - j) / a[i]; 
            if (i > 1) t = max(t, Down(i - 1, j));
            if (i < n) t = max(t, Up(i + 1, j)); 
            Ans = min(Ans, t);
        } 
    }
    if (Ans == inf) Ans = 0; 
    printf("%.12lf", Ans); 
    return 0; 
}

