		int lim = i + 1 == n ? 0 : a[i + 1] * 2;
		for (int j = 1; j <= a[i] * 2; ++j) {
			checkMax(dp[i][j], Frac(abs(j - a[i]), a[i]));
			for (int k = j; k <= lim; k += j) {
				checkMin(dp[i + 1][k], dp[i][j]);
			}
		}
	}
	Frac res;
	for (int i = 1; i <= a[n - 1] * 2; ++i) {
		checkMin(res, dp[n - 1][i]);
	}
	printf("%.13lf\n", (double)res.a / res.b);
	return 0;
}

