typedef long double ld;
map<pll,ld> mp;
ld rec(int n,ll x,ld maxT,vector<ll>& a){
    if(mp.count(pll(n,x))){
        return mp[pll(n,x)];
    }
    if(n == a.size()){
        return maxT;
    }
   ld ret = INF;
    if(x < a[n]){
        ll nextx = a[n]/x*x;
        ld nextT = max(maxT,abs(nextx-a[n])/(ld)a[n]);
        ret = min(ret,rec(n+1,nextx,nextT,a));
    }
    {
        ll nextx = (a[n]+x-1)/x*x;
        ld nextT = max(maxT,abs(nextx-a[n])/(ld)a[n]);
        ret = min(ret,rec(n+1,nextx,nextT,a));
    }
    return ret;
}
