using namespace std;

const double eps = 1e-8;
int N;
int a[20];
vector<double> v;

bool equals(double s, double t) {
  return fabs(s-t) < eps;
}

double cost(int s, int t) {
  return (double)abs(s-t)/s;
}

bool rec(int bx, int k, double lim) {
  if(k == N) return true;
  for(int d = -1; d <= 1; d += 2) {
    for(int i = 0; ; ++i) {
      if(i == 0 && d == 1) continue;
      int b = a[k]+d*i;
      if(b < bx) break;
      if(k && b % bx != 0) continue;
      double newV = cost(a[k], b);
      if(newV < lim || equals(newV, lim)) {
	if(rec(b, k+1, lim)) return true;
      } else {
	break;
      }
    }
  }
  return false;
}

double solve() {
  v.push_back(0.0);
  for(int m = 1; m <= 100000; ++m) {
    for(int i = 0; i < N; ++i) {
      v.push_back((double)m/a[i]);
    }
  }
  sort(v.begin(), v.end());
  int l = 0;
  int r = v.size();
  int ansi;
  while(l < r) {
    int m = (l+r)/2;
    if(rec(1, 0, v[m])) {
      ansi = m;
      r = m;
    } else {
      l = m+1;
    }
  }
  return v[ansi];
}

int main() {
  cin >> N;
  for(int i = 0; i < N; ++i) cin >> a[i];
  printf("%.12f\n", solve());
  return 0;
}

