void update(int idx) {
    for(int before = 1; before <= 2e5; before++) {
        for(int after = before; after <= 2e5; after += before) {
            long double delta = abs(after - a[idx]);
            chmin(dp[idx+1][after], max(dp[idx][before], delta / a[idx]));
        }
    }
}

