const double eps = 1e-9;
int N;
int a[20];
vector<double> v;

bool equals(double s, double t) {
  return fabs(s-t) < eps;
}

bool rec(int bx, int k, double lim) {
  if(k == N) return true;
  for(int b = bx; ; b += bx) {
    double newV = (double)abs(a[k]-b)/a[k];
    if(newV < lim || equals(newV, lim)) {
      if(rec(b, k+1, lim)) return true;
    } else {
      if(a[k] < b) break;
      else continue;
    }
  }
  return false;
}

double solve() {
  v.push_back(0.0);
  for(int m = 1; m <= 100000; ++m)
    for(int i = 0; i < N; ++i)
      v.push_back((double)m/a[i]);

  sort(v.begin(), v.end());

  int l = 0;
  int r = v.size();
  int ansi = 0;
  while(l < r) {
    int m = (l+r)/2;
    if(rec(1, 0, v[m])) ansi = r = m;
    else l = m+1;
  }
  return v[ansi];
}

int main() {
  cin >> N;
  for(int i = 0; i < N; ++i) cin >> a[i];
  printf("%.12f\n", solve());
  return 0;
}

