typedef  double ld;

vector<int> a;
bool check(ld th, int b0) {
	int b = b0;
	if (abs(a[0] - b) > a[0]*th) {
		return false;
	}
	for (int i = 1; i < a.size(); ++i) {
		int nb = b;
		if (nb < a[i]) {
			ld bb = a[i]*(1-th)/b;
			if (bb >= 0 && ceil(bb) >= 1) {
				nb = b * ceil(bb);
			}
		}
		b = nb;
		if (b >= a[i] && abs(a[i] - b) > a[i]*th) {
			return false;
		}
	}
	return true;
}
bool check(ld th) {
	for (int b0 = 1; b0 <= 1e5; ++b0) {
		int b = b0;
		if (check(th, b0)) {
			return true;
		}
	}
	return false;
}

