void dfs(int now, int step, double res)
{
	if(step >= n)
	{
		if(res <= ans)
			ans = res;
		return;
	}
	if(step == 0)
	{
		res = (abs(now - num[step]) * 1.0) / num[step];
		dfs(now, step + 1, res);
	}
	else
	{
		double th1, th2;
		if(!now)
			return;
		int be = num[step] / now;
		if(be)
		{
			th1 = abs(be * now - num[step]) * 1.0 / num[step];
			dfs(be * now, step + 1, max(res, th1));
		}
		be++;
		if(step + 1 < n && be * now > num[step + 1])
			return;
		th2 = abs(be * now - num[step]) * 1.0 / num[step];
		dfs(be * now, step + 1, max(res, th2));
	}
}

