int abs(int x) { return x > 0 ? x : -x; } 
db Up(int k, int x) 
{
          if (k == n + 1) return 0; 
          int t = a[k] / x, tA = abs(x * t - a[k]), tB = abs(x * (t + 1) - a[k]); 
          db c, d; 
          if (t) c = max((db)tA / a[k], Up(k + 1, x * t));
          d = max((db)tB / a[k], Up(k + 1, x * (t + 1))); 
          c = min(c, d);
          if (c > Ans) return inf; 
          else return c; 
}
db Down(int k, int x)
{
            if (!k) return 0; 
            int t = x / a[k], tA = abs(a[k] * t - x), tB = abs(a[k] * (t + 1) - x); 
            if (tA <= tB)
               return max((db)tA / a[k], Down(k - 1, x / t));
            else
                return max((db)tB / a[k], Down(k - 1, x / (t + 1))); 
}
