    int f = (int)(A[0] * m);  
    int Mi = A[0] - f > 1? A[0] - f : 1, Ma = A[0] + f;  
    for(int i = Mi;i <= Ma;i ++){  
        if(DFS(i, 1, fabs(A[0] - i) / A[0] * 1.0, m)) {  
                flag = true;  
        }  
    }  
    return flag;  
}  

