        double lb = -1,ub = 1.0;  
        while(ub - lb > eps){  
            double mid = (ub + lb) / 2.0;  
            if(C(mid)) ub = mid;  
            else lb = mid;  
        }  
        printf("%.12lf\n", M);  
    }  
    return 0;  
}

