        DFS(p+1,(k-i)*L,max(MaxR,1.0*(a[p]-L*(k-i))/a[p]));
    }
}

int main()
{
    while ( scanf("%d",&N)!=EOF )
    {
        for ( int i=0;i<N;i++ )
            scanf("%d",&a[i]);
        Ans = 1E99;
        DFS(1,a[0],0.0);
        for ( int i=1;1.0*i/a[0]<Ans;i++ )
        {
            DFS(1,a[0]+i,1.0*i/a[0]);
            DFS(1,a[0]-i,1.0*i/a[0]);
        }
        printf("%.12lf\n",Ans);
    }
    return 0;
}

