db Up(int k, int x) 
{
          if (k == n + 1) return 0; 
          int t = a[k] / x, tA = abs(x * t - a[k]), tB = abs(x * (t + 1) - a[k]); 
          db c, d; 
          if (t) c = max((db)tA / a[k], Up(k + 1, x * t));
