inline int dcmp(const double &d) {
	return d < -eps ? -1 : d > eps;
}

void get_data() {
	for(int i = 0; i < n; i++) scanf("%d", &a[i]);
}

LL find(LL pre, LL now) {
	LL left = 1, right = 100;
	LL ans;
	while(left <= right) {
		int mid = (left + right) >> 1;
		if(pre * mid * 1.0 >= 1e18) right = mid - 1;
		else if(pre * mid <= now) {
			ans = mid;
			left = mid + 1;
		}
		else right = mid - 1;
	}	
	return ans;
}

void gao() {
	double ans = 1e50;
	for(int i = 1; i <= 100000; i++) {
		double temp = abs(i - a[0]) * 1.0 / a[0];
		if(temp > ans) continue;
		LL pre = i;
		bool flag = true;
		for(int j = 1; j < n; j++) {
			LL nex = find(pre, a[j]);
			double tp1 = abs(pre * nex - a[j]) * 1.0 / a[j];
			double tp2 = abs(pre * nex + pre - a[j]) * 1.0 / a[j];
			double tp;
			if(tp1 > tp2) tp = tp2, pre *= nex + 1;
			else tp = tp1, pre *= nex;
			//cout<<pre<<' '<<tp<<endl;
			//getchar();
			temp = max(temp, tp);
			if(temp > ans) {
				flag = false;
				break;
			}
		}
		if(flag) {
			//cout<<i<<endl;
			ans = temp;
		}
	}	
	printf("%.20f\n", ans);
}

int main() {
	while(~scanf("%d", &n)) {
		get_data();
		gao();
	}	
}

