    scanf("%d",&n);
    t[m++]=ConfusionRatio(0,1);
    for(int i=0;i<n;++i)
    {
        scanf("%d",&a[i]);
        for(int j=1;j<a[i];++j) t[m++]=ConfusionRatio(j,a[i]);
    }
    sort(t,t+m);
    int N=0;
    for(int i=0;i<m;)
    {
        t[N++]=t[i];
        int j=i+1;
        while(j<m&&(t[j]==t[i])) j++;
        i=j;
    }
    int l=0,r=N-1;
    while(l+1<r)
    {
        int mid=(l+r)>>1;
        if(check(mid)) r=mid;
        else l=mid+1;
    }
    if(check(l)) printf("%.12f\n",t[l].fz*1.0/t[l].fm);
    else printf("%.12f\n",t[r].fz*1.0/t[r].fm);
    return 0;
}

