double calc(int depth, int prev) {
  if (depth == n) { return 0.0; }
  if (!isnan(memo[depth][prev])) { return memo[depth][prev]; }
  double ret = 1e+100;
  int nv = prev;
  while (nv <= 20000) {
    ret = min(ret, max(calc(depth + 1, nv), (double)abs(current[depth] - nv) / current[depth]));
    nv += prev;
  }
  return memo[depth][prev] = ret;
}

