    M = 2*10**5
    INF = 10**18
    dist = [[INF]*(M+1) for i in range(N+1)]
    que = [(0, 0, 1)]
    while que:
        cost, i, p = heappop(que)
        if i == N:
            break
        if dist[i][p] + 1e-10 < cost:
